import React from 'react';
import styled from 'styled-components';
import AlarmItem from "./AlarmListPage/AlarmItem"

const AlarmListBlock = styled.div`
  flex: 1;
  padding: 20px 32px;
  padding-bottom: 48px;
  overflow-y: auto;
//   background: gray; /* 사이즈 조정이 잘 되고 있는지 확인하기 위한 임시 스타일 */
`;

function AlarmList() {
  return <AlarmListBlock>알림 리스트</AlarmListBlock>;
}

export default AlarmList;
